    const[temp,setTemp]=useState("")
const change=(i)=>{
    setTemp(i.target.value)
}
    
    return(
        <div>
            <center>
            <input type="text"  value={temp}  onChange={change} placeholder="Enter City"/>
            </center>
        </div>
    )
}
export default Weather;
